import React from "react";
import { useHistory, useParams } from "react-router-dom";
 const Page2 = () => {
    let history = useHistory();
    const { account, amount,remark } = useParams();
    return (
      <div style={{
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        height: '90vh',
        gap:' 1rem'
      }}>
        <h1>Account:{account}</h1> 
        <h1><br /></h1>
        <h1>Amount:{amount }</h1>
        <h1>Remark:{remark }</h1>
      </div>
    )
};

export default Page2;
